const Fetchtoken=(username, password)=>{
    fetch("http://localhost:5000/api/login",{
        method: 'POST',
        headers: new Headers({
            'Content-Type': 'application/json'
    })}).then(
        res=>res.json()
        ).catch(err => {
            err.toString();
    })
}

export default Fetchtoken;
